import React, {useState, useEffect} from 'react';
import Counter from './counter';

function App() {

  const lists = [
    {name : 'Song', index : 1},
    {name : 'Jae', index : 2},
    {name : 'Hyeok', index : 3}
  ]

  const renderName = lists.map(list =>{
    return(
      <div>
        <div className="list_name">{list.name}</div>
        <div className="list_index">{list.index}</div>
      </div>
    );
  })
  return (
    <div className="App">
      {renderName}
    </div>
  );
}

export default App;
